namespace MunicipalityRegistry.Tests
{
    using System;
    using Be.Vlaanderen.Basisregisters.Crab;
    using Be.Vlaanderen.Basisregisters.Utilities.HexByteConvertor;
    using FluentAssertions;
    using Municipality.Commands.Crab;
    using NodaTime;
    using Xunit;

    public class ImportDeterministicGuidTests
    {
        [Fact]
        public void Given_ImportMunicipalityFromCrabCommand_When_creating_CommandId_Then_CommandId_is_expected_Guid()
        {
            var hexString = @"";
            var geometry = new WkbGeometry(hexString.ToByteArray());

            var expectedGuid = new Guid("be595518-7a1c-5bdc-8f00-b9ba61291326");
            var importMunicipalityFromCrabCommand = new ImportMunicipalityFromCrab(
                new NisCode("11001"),
                CrabLanguage.Dutch,
                null,
                null,
                geometry,
                null,
                new CrabLifetime(LocalDateTime.FromDateTime(new DateTime(1830,1,1)), null),
                new CrabTimestamp(Instant.FromUtc(2002,8,13,17,32,32)),
                new CrabOperator("VLM\\thijsge"),
                CrabModification.Insert,
                CrabOrganisation.Ngi,
                new CrabMunicipalityId(1));

            importMunicipalityFromCrabCommand
                .ToString()
                .Should()
                .Be(@"11001, Dutch, , , , 1830-01-01T00:00:00.000000000, 2002-08-13T17:32:32Z, VLM\thijsge, Insert, Ngi, , 1");

            var createdId = importMunicipalityFromCrabCommand.CreateCommandId();

            createdId.Should().Be(expectedGuid);
        }

        [Fact]
        public void Given_ImportMunicipalityNameFromCrabCommand_When_creating_CommandId_Then_CommandId_is_expected_Guid()
        {
            var expectedGuid = new Guid("cea206ae-a87c-50bd-9e77-675a6f421762");
            var importMunicipalityNameFromCrab = new ImportMunicipalityNameFromCrab(
                new CrabMunicipalityId(1),
                new CrabMunicipalityName("Aartselaar", CrabLanguage.Dutch),
                new CrabLifetime(LocalDateTime.FromDateTime(new DateTime(1830, 1, 1)), null),
                new CrabTimestamp(Instant.FromUtc(2002, 8, 13, 17, 32, 32)),
                new CrabOperator("VLM\\thijsge"),
                CrabModification.Insert,
                CrabOrganisation.Ngi,
                new CrabMunicipalityNameId(1));

            importMunicipalityNameFromCrab
                .ToString()
                .Should()
                .Be(@"1, Aartselaar (Dutch), 1830-01-01T00:00:00.000000000, 2002-08-13T17:32:32Z, VLM\thijsge, Insert, Ngi, 1");

            var createdId = importMunicipalityNameFromCrab.CreateCommandId();

            createdId.Should().Be(expectedGuid);
        }
    }
}
